def encrypt(s):
    alphabet = 'abcdefghijklmnopqrstuvwxyz'
    shift = 2 * 2
    encrypted = ''
    for char in s:
        if char in alphabet:
            index = (alphabet.index(char) + shift) % 26
            encrypted += alphabet[index]
        else:
            encrypted += char
    return encrypted

