def encode(message):
    vowels = 'aeiouAEIOU'
    encoded = ''
    for char in message:
        if char.isalpha():
            if char.islower():
                encoded += char.upper()
            else:
                encoded += char.lower()
            if char in vowels:
                encoded += chr(ord(char) + 2)
        else:
            encoded += char
    return encoded

