def fix_spaces(text):
    result = ""
    space_count = 0
    for char in text:
        if char == " ":
            space_count += 1
            if space_count == 1:
                result += "_"
            elif space_count == 2:
                result += "-"
        else:
            if space_count > 0:
                if space_count == 1:
                    result += "_"
                elif space_count == 2:
                    result += "-"
                space_count = 0
            result += char
    if space_count > 0:
        if space_count == 1:
            result += "_"
        elif space_count == 2:
            result += "-"
    return result

